import React from 'react';
import faker from 'faker';

let recipies=[];
const size = 10;
for(let i=0;i<size;i++){
    recipies.push(Faker.Food.dish());
}

const Home = ()=>{
    return(
        <div>
            <h1>Home</h1>
        </div>
    )
}
export default Home;
